import React, { Component } from 'react'

export class Footer extends Component {
    constructor(props) {
        super(props);
        console.log(props)
    }
  render() {
     return this.props.fotterData.map((indexData) => {
         console.log(indexData.name)
     })
  }
}

export default Footer
